import React from "react";

function Contact() {
  return (
    <div className="flex h-36 items-center justify-around bg-basecolor p-8 text-basefont">
      <div>
        <h3 className="text-3xl font-bold ">Interest to Request Contact us</h3>
        <p className="text-[15px]">Sign up is easy just fill out to your email</p>
      </div>

      <div>
        <input type="text"></input>
        <button>Notify me</button>
        <p>We care about the protection of your data</p>
        <p>
          <a href="#fe"> Privacy poliyc</a>
        </p>
      </div>
    </div>
  );
}

export default Contact;
